import { createSlice } from "@reduxjs/toolkit";

const initialState = {}


export const cartSlice = createSlice({
    name: 'cart',
    initialState,
    reducers:{}
})

export const { } = cartSlice.actions;

export const uiReducer =   cartSlice.reducer;
